import React from 'react';
import {
	AppBar,
	Toolbar,
	Button,
	Typography,
	makeStyles,
} from '@material-ui/core';
import LogoutSwitch from './LogoutSwitch';

const useStyles = makeStyles({
	tool: {
		display: 'flex',
		alignItems: 'center',
		justifyContent: 'space-between',
	},
	heading: {
		fontSize: '2rem',
		// paddingTop: '3rem',
	},
});

export default function Navbar({ loggedIn, setLoggedIn, setDialogOpen }) {
	const classes = useStyles();
	return (
		<React.Fragment>
			<AppBar>
				<Toolbar className={classes.tool}>
					<LogoutSwitch loggedIn={loggedIn} setLoggedIn={setLoggedIn} />
					<Typography as='h1' align='center' className={classes.heading}>
						All The Friends ?
					</Typography>
					<Button onClick={() => setDialogOpen(true)}>Add Friend!</Button>
				</Toolbar>
			</AppBar>
			<Toolbar />
		</React.Fragment>
	);
}
